import React, { useEffect, useState } from "react";
import StandingLine from "./StandingLine";
import ApiManager from "../../api/ApiManager"; 

function Standings() {
    const api = new ApiManager();
    const [standingData, setStandingData] = useState([]);
    const [leagueData, setLeagueData] = useState([]);

    useEffect(() => {
        const fetchData = async () => {
            try {
                // const responseStanding = await api.makeRequest("standings?league=135&season=2023");
                const fakeData = Array.from({ length: 10 }, (_, index) => ({
                    team: { logo: `https://media.api-sports.io/football/teams/${index + 33}.png`, name: `Team ${index + 1}` },
                    all: { win: index+2, draw: index, lose: index+5, played: index+10 },
                    points: index+4,
                    rank: index + 1,
                }));

                setStandingData(fakeData);
                setLeagueData({ name: "Fake League", logo: "https://media.api-sports.io/football/teams/33.png", flag: "https://media.api-sports.io/football/teams/3.png" });
            } catch (error) {
                console.log(error);
            }
        };

        fetchData(); 

    }, []);

    return (
        <>
            <div className="flex flex-col gap-2">
                <div className="flex justify-between px-4">
                    <div className="flex gap-5 items-center basis-6/12">
                        <div className="h-10 w-10 rounded-full flex items-center justify-center" style={{border: "0.05em solid #a19db3"}}>
                            <img className="h-7 w-7 object-cover rounded-full" src={leagueData.flag} alt="leagueIcon" />
                        </div>
                        <div className="text-xl font-medium">{leagueData.name}</div> 
                        <button id="dropdownRightEndButton" data-dropdown-toggle="dropdownRightEnd" data-dropdown-placement="right-end" class="mb-3 md:mb-0 text-white bg-blue-700 hover:bg-blue-800 focus:ring-4 focus:outline-none focus:ring-blue-300 font-medium rounded-lg text-sm px-5 py-2.5 text-center inline-flex items-center dark:bg-blue-600 dark:hover:bg-blue-700 dark:focus:ring-blue-800" type="button">Dropdown right end<svg class="w-2.5 h-2.5 ms-3 rtl:rotate-180" aria-hidden="true" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 6 10">
                        <path stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="m1 9 4-4-4-4"/>
                        </svg>
                        </button>

                        <div id="dropdownRightEnd" class="z-10 hidden bg-white divide-y divide-gray-100 rounded-lg shadow w-44 dark:bg-gray-700">
                            <ul class="py-2 text-sm text-gray-700 dark:text-gray-200" aria-labelledby="dropdownRightEndButton">
                            <li>
                                <a href="#" class="block px-4 py-2 hover:bg-gray-100 dark:hover:bg-gray-600 dark:hover:text-white">Dashboard</a>
                            </li>
                            <li>
                                <a href="#" class="block px-4 py-2 hover:bg-gray-100 dark:hover:bg-gray-600 dark:hover:text-white">Settings</a>
                            </li>
                            <li>
                                <a href="#" class="block px-4 py-2 hover:bg-gray-100 dark:hover:bg-gray-600 dark:hover:text-white">Earnings</a>
                            </li>
                            <li>
                                <a href="#" class="block px-4 py-2 hover:bg-gray-100 dark:hover:bg-gray-600 dark:hover:text-white">Sign out</a>
                            </li>
                            </ul>
                        </div>                   
                    </div>
                    <div className="flex items-center basis-5/12 text-end">
                        <div className="text-[#6d6a7f] text-sm basis-2/12 ">G</div>
                        <div className="text-[#6d6a7f] text-sm basis-2/12 ">V</div>
                        <div className="text-[#6d6a7f] text-sm basis-2/12 ">N</div>
                        <div className="text-[#6d6a7f] text-sm basis-2/12 ">P</div>
                        <div className="text-[#6d6a7f] text-sm basis-2/12 ">DR</div>
                        <div className="text-sm basis-2/12 font-medium">PT</div>
                    </div>
                </div>
                {standingData.map((team, index) => (
                    <StandingLine
                        key={index}
                        teamLogo={team.team.logo}
                        teamName={team.team.name}
                        teamWins={team.all.win}
                        teamDraws={team.all.draw}
                        teamLose={team.all.lose}
                        teamPoints={team.points}
                        teamPlayed={team.all.played}
                        number={team.rank}
                        teamId={team.team.id}
                    />
                ))}
            </div>
        </>
    )
}

export default Standings;
